import React from "react";

function ButtonPage() {
  return (
    <center>
      <>
        <a href="registerClient" variant="register" class="btnCrud btn-info" size="lg" active>
          Register
        </a>
        <a href="updateClient" variant="update" class="btnCrud btn-info" size="lg" active>
          Update
        </a>
        <a href="deleteClient" variant="delete" class="btnCrud btn-info" size="lg" active>
          Delete
        </a>
      </>
    </center>
  );
}
export default ButtonPage;
